import React from 'react'

function Footer() {
  return (
    <div>
      <p className='text-xs text-gray-500'>At Fight club, we believe that every young man has the potential to achieve greatness.
         Our mission is to provide the tools, resources, and community support needed to help you succeed
          in all areas of life—from career and finances to personal growth and relationships. Whether you’re 
          just starting out or looking to level up, we’re here to guide you on your journey to success. 
          Join us as we empower the next generation of leaders, thinkers, and innovators.</p>
    </div>  
  )
}

export default Footer
